import React from "react";
import { useState } from 'react';
import Swal from 'sweetalert2';




function Checkout() {

    const [direccion, setDireccion] = useState({
        calle: "",
        estado: "",
        zipcode: "",
        telefono: ""
    })

    const handleSubmit = (e) => {
        e.preventDefault()
        console.log(direccion);
    }

    return (
        <>
            <nav id="topNav">
                <h1>Proceder al pago</h1>
            </nav>

            <form onSubmit={handleSubmit} id="direccionFrom">
                <label >
                    Ingrese la calle y el número
                </label>
                <input
                    type="text"
                    placeholder="Calle número"
                    value={direccion.calle}
                    onChange={(e) => setDireccion({ ...direccion, calle: e.target.value })}
                >

                </input>

                <label >
                    Ingrese el estado
                </label>
                <input
                    type="text"
                    placeholder="Estado"
                    value={direccion.estado}
                    onChange={(e) => setDireccion({ ...direccion, estado: e.target.value })}
                >

                </input>

                <label >
                    Ingrese el código postal
                </label>
                <input
                    type="text"
                    placeholder="Código postal"
                    value={direccion.zipcode}
                    onChange={(e) => setDireccion({ ...direccion, zipcode: e.target.value })}
                >

                </input>

                <label >
                    Ingrese su numero teléfonico
                </label>
                <input
                    type="text"
                    placeholder="Numero de teléfono"
                    value={direccion.telefono}
                    onChange={(e) => setDireccion({ ...direccion, telefono: e.target.value })}
                >

                </input>
                <button 
                type="submit"
                onClick={Swal.fire("Dirección guardada")}>Guardar dirección</button>
            </form>


        </>
    );
}

export default Checkout;
